import TextField from '@material-ui/core/TextField';
import SearchIcon from '@material-ui/icons/Search';
import InputAdornment from '@material-ui/core/InputAdornment';
import '../Style.css'
import { IconButton, InputLabel, Input, FormControl } from '@material-ui/core';

export default function Searchbar(){
    return(
        <div>
            {/* <TextField className = "searchbar" id="outlined-basic" label="Search for a movie" variant="outlined" */}
            <FormControl className="searchbar">
                <InputLabel>Search for a movie</InputLabel>
                <Input
            startAdornment={
              <InputAdornment position="start">
                <IconButton>
                    <SearchIcon />
                </IconButton>
              </InputAdornment>
            }/>
            </FormControl>


        </div>
    )
}
